import React from 'react';
import history from './history.js';

export default class TestInstruc extends React.Component{
    constructor()
    {
        super();
        this.state ={
            name:''
        }
    }

    onInputChange=(e)=>{
        this.setState({
            name:e.target.value
        });
    }
    render()
    {
        return(
            <div>
                <h3>Instructions for giving the Examination</h3>
                <input className="form-control m-3" name="name"onChange={this.onInputChange} value={this.state.name}   type="text" placeholder="Name" />
                <button type="button" className="btn btn-primary" 
                onClick={()=>{
                    history.push('./test');
                    localStorage.setItem('name',this.state.name)
                }
                }>Start</button>
            </div>
        );
    }
}
